    false,nt"url": null,nt"notes": "Dead and sick waterfowl found on the Kern
    National Wildlife  Refuge in late June, 1973, were diagnosed as positive for  botulism
    toxin. Despite immediate control efforts, the epidemic  soon spread to the nearby
    Pixley National Wildlife  Refuge and to flooded agricultural land in the historic
    Tulare  Lake Basin., Department of Fish and Game and U. Su201e Bureau of  Sport
    Fisheries and Wildlife crews maintained a joint control  effort throughout the summer
    and botulism losses in the  southern San Joaquin Valley were limited to 3,775 birds,
    A  bird hospital was established and 1,041 sick birds were treated  with a 73 percent
    recovery rate for ducks and a 13 percent recovery  rate on all other birds.",nt"owner_org":
